    "summary": "You can never have too many dessert recipes, so give Pear-ginger upside-down cake a try. For <b>75 cents per serving</b>, this recipe <b>covers 9%</b> of your daily requirements of vitamins and minerals. Watching your figure? This vegetarian recipe has <b>325 calories</b>, <b>6g of protein</b>, and <b>10g of fat</b> per serving. Only a few people made this recipe, and 9 would say it hit the spot. Head to the store and pick up baking powder, baking soda, salt, and a few other things to make it today. From preparation to the plate, this recipe takes about <b>45 minutes</b>. All things considered, we decided this recipe <b>deserves a spoonacular score of 30%</b>. This score is rather bad. Try <a href=\"https://spoonacular.com/recipes/pear-ginger-upside-down-cake-166922\">Pear-Ginger Upside-Down Cake</a>, <a href=\"https://spoonacular.com/recipes/pear-and-ginger-upside-down-cake-41929\">Pear and Ginger Upside-Down Cake</a>, and <a href=\"https://spoonacular.com/recipes/upside-down-pear-ginger-cake-68092\">Upside Down Pear Ginger Cake</a> for similar recipes.",
