    "summary": "You can never have too many main course recipes, so give Southern Fried Catfish a try. Watching your figure? This dairy free and pescatarian recipe has <b>786 calories</b>, <b>101g of protein</b>, and <b>32g of fat</b> per serving. For <b>$8.78 per serving</b>, this recipe <b>covers 40%</b> of your daily requirements of vitamins and minerals. A few people made this recipe, and 39 would say it hit the spot. This recipe is typical of Southern cuisine. Head to the store and pick up dressed catfish, salt, garlic powder, and a few other things to make it today. To use up the salt you could follow this main course with the <a href=\"https://spoonacular.com/recipes/apple-turnovers-recipe-48175\">Apple Turnovers Recipe</a> as a dessert. All things considered, we decided this recipe <b>deserves a spoonacular score of 94%</b>. This score is spectacular. Similar recipes include <a href=\"https://spoonacular.com/recipes/southern-fried-catfish-349181\">Southern Fried Catfish</a>, <a href=\"https://spoonacular.com/recipes/southern-fried-catfish-244061\">Southern Fried Catfish</a>, and <a href=\"https://spoonacular.com/recipes/southern-fried-catfish-301703\">Southern Fried Catfish</a>.",
