    "summary": "You can never have too many American recipes, so give Old Fashioned Mac and Cheese #SundaySupper a try. One serving contains <b>2582 calories</b>, <b>105g of protein</b>, and <b>138g of fat</b>. This recipe serves 2 and costs $4.06 per serving. This recipe from Foodista requires pepper, flour, milk, and butter. It works well as a rather expensive main course. This recipe is liked by 11 foodies and cooks. From preparation to the plate, this recipe takes approximately <b>approximately 45 minutes</b>. With a spoonacular <b>score of 90%</b>, this dish is awesome. Users who liked this recipe also liked <a href=\"https://spoonacular.com/recipes/jalapeno-bacon-mac-n-cheese-sundaysupper-490175\">Jalapeno & Bacon Mac n’ Cheese #SundaySupper</a>, <a href=\"https://spoonacular.com/recipes/white-queso-mac-and-cheese-for-two-sundaysupper-582595\">White Queso Mac and Cheese for Two #SundaySupper</a>, and <a href=\"https://spoonacular.com/recipes/italian-mac-and-cheese-stuffed-peppers-sundaysupper-ggholiday2013-512019\">Italian Mac and Cheese Stuffed Peppers #SundaySupper #GGHoliday2013</a>.",
