    "summary": "Allergy-Free Thin Mints might be just the hor d'oeuvre you are searching for. One serving contains <b>17 calories</b>, <b>0g of protein</b>, and <b>0g of fat</b>. For <b>6 cents per serving</b>, this recipe <b>covers 0%</b> of your daily requirements of vitamins and minerals. A couple people made this recipe, and 18 would say it hit the spot. If you have tablespoons dairy-free, granulated sugar, tablespoons hershey's “special dark” cocoa powder, and a few other ingredients on hand, you can make it. From preparation to the plate, this recipe takes around <b>45 minutes</b>. It is a good option if you're following a <b>gluten free and vegan</b> diet. All things considered, we decided this recipe <b>deserves a spoonacular score of 7%</b>. This score is improvable. Try <a href=\"https://spoonacular.com/recipes/gluten-free-thin-mints-617945\">Gluten Free Thin Mints </a>, <a href=\"https://spoonacular.com/recipes/gluten-free-thin-mints-552725\">Gluten Free Thin Mints</a>, and <a href=\"https://spoonacular.com/recipes/homemade-thin-mints-low-carb-and-gluten-free-767999\">Homemade Thin Mints (Low Carb and Gluten Free)</a> for similar recipes.",
