    "summary": "Bacon & Potato Soup, Gluten & Dairy Free might be just the main course you are searching for. Watching your figure? This dairy free recipe has <b>410 calories</b>, <b>20g of protein</b>, and <b>17g of fat</b> per serving. This recipe serves 6 and costs $1.97 per serving. This recipe from Foodista has 47 fans. If you have savoy cabbage, bacon, worcestershire sauce, and a few other ingredients on hand, you can make it. It will be a hit at your <b>Autumn</b> event. From preparation to the plate, this recipe takes roughly <b>roughly 45 minutes</b>. Taking all factors into account, this recipe <b>earns a spoonacular score of 70%</b>, which is solid. Similar recipes are <a href=\"https://spoonacular.com/recipes/healthy-sweet-potato-casserole-gluten-free-nut-free-dairy-free-1052405\">Healthy Sweet Potato Casserole (gluten-free, nut-free, dairy-free)</a>, <a href=\"https://spoonacular.com/recipes/2-ingredient-sweet-potato-pancakes-gluten-free-dairy-free-nut-free-630749\">2-ingredient Sweet Potato Pancakes {gluten-free, dairy-free, nut-free}</a>, and <a href=\"https://spoonacular.com/recipes/sweet-potato-kimchi-hash-brunch-gluten-free-dairy-free-vegetarian-662584\">Sweet Potato Kimchi Hash Brunch - gluten free, dairy free, vegetarian</a>.",
