    "summary": "Rotisserie Chicken and Bean Tostadas is a Mexican recipe that serves 3. This hor d'oeuvre has <b>401 calories</b>, <b>31g of protein</b>, and <b>16g of fat</b> per serving. For <b>$1.85 per serving</b>, this recipe <b>covers 23%</b> of your daily requirements of vitamins and minerals. If you have rotisserie chicken, iceberg lettuce, cotija cheese, and a few other ingredients on hand, you can make it. It is brought to you by Foodista. Not a lot of people made this recipe, and 1 would say it hit the spot. From preparation to the plate, this recipe takes roughly <b>30 minutes</b>. It is a good option if you're following a <b>gluten free</b> diet. Overall, this recipe earns a <b>solid spoonacular score of 76%</b>. If you like this recipe, take a look at these similar recipes: <a href=\"https://spoonacular.com/recipes/rotisserie-chicken-tostadas-217299\">Rotisserie Chicken Tostadas</a>, <a href=\"https://spoonacular.com/recipes/chicken-and-black-bean-tostadas-249183\">Chicken-and-Black Bean Tostadas</a>, and <a href=\"https://spoonacular.com/recipes/black-bean-and-chicken-tostadas-26555\">Black Bean-and-Chicken Tostadas</a>.",
