    "instructions": "<ol><li>Preheat oven to 350 degrees.</li><li>Place corn tortillas on a cookie sheet and bake for 16-17 minutes or until the edges brown and curl.</li><li>Cool cooked tortillas at room temperature.</li><li>To build the tostadas, start by spreading 1-2 tablespoons of refried beans on each tortilla.</li><li>Next, top with a handful of shredded rotisserie chicken, shredded iceberg lettuce, diced tomato, and guacamole.</li><li>Drizzle with the juice of one lime wedge.</li><li>Sprinkle with cotija cheese.</li><li>Drizzle with salsa.</li><li>Garnish with jalapeos.</li><li>Serve open-faced.</li></ol><p>Makes 6 tostadas. Serving size is 2 tostadas.</p>",
