    "summary": "Classic Macaroni and Cheese might be just the main course you are searching for. One serving contains <b>945 calories</b>, <b>36g of protein</b>, and <b>54g of fat</b>. For <b>$1.51 per serving</b>, this recipe <b>covers 27%</b> of your daily requirements of vitamins and minerals. This recipe from Foodista has 11 fans. A mixture of bread crumbs, milk, cayenne pepper, and a handful of other ingredients are all it takes to make this recipe so scrumptious. To use up the flour you could follow this main course with the <a href=\"https://spoonacular.com/recipes/apple-tart-with-caramel-sauce-47961\">Apple Tart with Caramel Sauce</a> as a dessert. All things considered, we decided this recipe <b>deserves a spoonacular score of 71%</b>. This score is solid. Try <a href=\"https://spoonacular.com/recipes/classic-macaroni-and-cheese-569543\">Classic Macaroni and Cheese</a>, <a href=\"https://spoonacular.com/recipes/classic-macaroni-and-cheese-830577\">Classic Macaroni and Cheese</a>, and <a href=\"https://spoonacular.com/recipes/classic-macaroni-and-cheese-612278\">Classic Macaroni and Cheese</a> for similar recipes.",
