    "summary": "If you want to add more <b>gluten free, dairy free, paleolithic, and primal</b> recipes to your recipe box, Apple Roasted Pork Loin might be a recipe you should try. For <b>$3.54 per serving</b>, this recipe <b>covers 27%</b> of your daily requirements of vitamins and minerals. This recipe serves 6. This main course has <b>512 calories</b>, <b>51g of protein</b>, and <b>17g of fat</b> per serving. 7 people have made this recipe and would make it again. From preparation to the plate, this recipe takes around <b>45 minutes</b>. It is brought to you by Foodista. If you have rib roast, granny smith apples, olive oil, and a few other ingredients on hand, you can make it. Overall, this recipe earns a <b>pretty good spoonacular score of 57%</b>. Try <a href=\"https://spoonacular.com/recipes/roasted-pork-loin-with-apple-onion-dried-plum-stuffing-45905\">Roasted Pork Loin With Apple, Onion & Dried Plum Stuffing</a>, <a href=\"https://spoonacular.com/recipes/roasted-pork-loin-with-roasted-garlic-vinaigrette-293351\">Roasted Pork Loin with Roasted Garlic Vinaigrette</a>, and <a href=\"https://spoonacular.com/recipes/apple-glazed-pork-loin-81881\">Apple-glazed Pork Loin</a> for similar recipes.",
