    "summary": "Spanish Meatballs In Tomato Sauce might be just the <b>European</b> recipe you are searching for. Watching your figure? This dairy free recipe has <b>126 calories</b>, <b>6g of protein</b>, and <b>8g of fat</b> per serving. This recipe serves 20 and costs 59 cents per serving. This recipe is liked by 10 foodies and cooks. Head to the store and pick up egg, tomatoes, sugar, and a few other things to make it today. From preparation to the plate, this recipe takes around <b>45 minutes</b>. All things considered, we decided this recipe <b>deserves a spoonacular score of 29%</b>. This score is rather bad. Try <a href=\"https://spoonacular.com/recipes/spanish-style-lamb-meatballs-with-spicy-tomato-sauce-620788\">Spanish Style Lamb Meatballs with Spicy Tomato Sauce</a>, <a href=\"https://spoonacular.com/recipes/spanish-meatballs-with-almond-sauce-553384\">Spanish Meatballs with Almond Sauce</a>, and <a href=\"https://spoonacular.com/recipes/spanish-stuffed-meatballs-with-romesco-sauce-836361\">Spanish Stuffed Meatballs with Romesco Sauce</a> for similar recipes.",
