    "summary": "The recipe Buckwheat Banana Pancakes can be made <b>in roughly 30 minutes</b>. This recipe serves 1. Watching your figure? This gluten free recipe has <b>455 calories</b>, <b>11g of protein</b>, and <b>15g of fat</b> per serving. For <b>$1.35 per serving</b>, this recipe <b>covers 22%</b> of your daily requirements of vitamins and minerals. This recipe is liked by 76 foodies and cooks. Head to the store and pick up flax seed, baking powder, cinnamon, and a few other things to make it today. It works well as an affordable breakfast. It is brought to you by Foodista. With a spoonacular <b>score of 38%</b>, this dish is not so great. If you like this recipe, take a look at these similar recipes: <a href=\"https://spoonacular.com/recipes/banana-buckwheat-pancakes-162269\">Banana Buckwheat Pancakes</a>, <a href=\"https://spoonacular.com/recipes/banana-buckwheat-pancakes-759985\">Banana Buckwheat Pancakes</a>, and <a href=\"https://spoonacular.com/recipes/banana-buckwheat-quinoa-pancakes-837800\">Banana Buckwheat Quinoa Pancakes</a>.",
