    "summary": "Sweet Floridan Orange Breakfast Bread requires roughly <b>roughly 45 minutes</b> from start to finish. This recipe makes 16 servings with <b>345 calories</b>, <b>4g of protein</b>, and <b>13g of fat</b> each. For <b>46 cents per serving</b>, this recipe <b>covers 6%</b> of your daily requirements of vitamins and minerals. 6 people found this recipe to be yummy and satisfying. A mixture of butter, orange juice, vanillan extract, and a handful of other ingredients are all it takes to make this recipe so scrumptious. It is a good option if you're following a <b>lacto ovo vegetarian</b> diet. It is brought to you by Foodista. Only a few people really liked this breakfast. Overall, this recipe earns a <b>not so super spoonacular score of 16%</b>. If you like this recipe, take a look at these similar recipes: <a href=\"https://spoonacular.com/recipes/crispy-pan-seared-florida-snapper-with-passion-fruit-cream-and-florida-citrus-and-shaved-fennel-salad-garnished-with-sauteed-florida-gulf-shrimp-and-spicy-green-mango-jam-740791\">Crispy Pan Seared Florida Snapper with Passion Fruit Cream and Florida Citrus and Shaved Fennel Salad, Garnished with Sauteed Florida Gulf Shrimp and Spicy Green Mango Jam</a>, <a href=\"https://spoonacular.com/recipes/florida-orange-cake-401320\">Floridan Orange Cake</a>, and <a href=\"https://spoonacular.com/recipes/orange-rhubarb-breakfast-bread-430770\">Orange-Rhubarb Breakfast Bread</a>.",
