    "summary": "Fresh corn, roasted tomato & pickled garlic pizza with cornmeal crust is a Mediterranean recipe that serves 4. One portion of this dish contains about <b>19g of protein</b>, <b>31g of fat</b>, and a total of <b>747 calories</b>. For <b>$3.33 per serving</b>, this recipe <b>covers 30%</b> of your daily requirements of vitamins and minerals. It works best as a main course, and is done in around <b>roughly 45 minutes</b>. It is brought to you by Foodista. Head to the store and pick up sea salt, basil, extra virgin olive oil, and a few other things to make it today. This recipe is liked by 9 foodies and cooks. Taking all factors into account, this recipe <b>earns a spoonacular score of 88%</b>, which is spectacular. Similar recipes are <a href=\"https://spoonacular.com/recipes/cheese-and-tomato-pizza-with-garlic-bread-crust-534394\">Cheese and Tomato Pizza with Garlic Bread Crust</a>, <a href=\"https://spoonacular.com/recipes/taco-pizza-with-easy-cornmeal-crust-plus-pizza-kit-giveaway-628741\">Taco Pizza with Easy Cornmeal Crust {PLUS Pizza Kit Giveaway!}</a>, and <a href=\"https://spoonacular.com/recipes/roasted-tomato-pizza-with-fresh-basil-and-homemade-pizza-sauce-618526\">Roasted Tomato Pizza with Fresh Basil and Homemade Pizza Sauce</a>.",
