    "summary": "If you want to add more <b>Chinese</b> recipes to your collection, Asian Dumplings might be a recipe you should try. This recipe serves 1. Watching your figure? This dairy free recipe has <b>4275 calories</b>, <b>192g of protein</b>, and <b>114g of fat</b> per serving. For <b>$18.55 per serving</b>, this recipe <b>covers 82%</b> of your daily requirements of vitamins and minerals. 6 people have tried and liked this recipe. From preparation to the plate, this recipe takes approximately <b>approximately 45 minutes</b>. It is brought to you by Foodista. It works well as a hor d'oeuvre. If you have sugar, water, scallions, and a few other ingredients on hand, you can make it. With a spoonacular <b>score of 88%</b>, this dish is outstanding. If you like this recipe, you might also like recipes such as <a href=\"https://spoonacular.com/recipes/seriously-asian-all-about-dumplings-10036\">Seriously Asian: All About Dumplings</a>, <a href=\"https://spoonacular.com/recipes/asian-dumplings-558806\">Asian Dumplings</a>, and <a href=\"https://spoonacular.com/recipes/asian-shrimp-dumplings-45968\">Asian Shrimp Dumplings</a>.",
