    "summary": "The recipe Mardi Gras Cupcakes could satisfy your American craving in roughly <b>45 minutes</b>. This recipe serves 14 and costs $1.12 per serving. This dessert has <b>565 calories</b>, <b>3g of protein</b>, and <b>35g of fat</b> per serving. Only a few people made this recipe, and 6 would say it hit the spot. A mixture of oil olive oil, malibu coconut rum, buttermilk, and a handful of other ingredients are all it takes to make this recipe so yummy. All things considered, we decided this recipe <b>deserves a spoonacular score of 12%</b>. This score is not so spectacular. Try <a href=\"https://spoonacular.com/recipes/mardi-gras-cupcakes-672147\">Mardi Gras Cupcakes</a>, <a href=\"https://spoonacular.com/recipes/mardi-gras-cupcakes-373068\">Mardi Gras Cupcakes</a>, and <a href=\"https://spoonacular.com/recipes/mardi-gras-king-cupcakes-508422\">Mardi Gras King Cupcakes</a> for similar recipes.",
