    "summary": "If you want to add more <b>lacto ovo vegetarian</b> recipes to your recipe box, Fresh Fig, Walnut, Rosemary Upside Down Cake And A Crisp Citrusy Chardonnay might be a recipe you should try. This recipe serves 8. One serving contains <b>378 calories</b>, <b>6g of protein</b>, and <b>11g of fat</b>. For <b>$1.57 per serving</b>, this recipe <b>covers 8%</b> of your daily requirements of vitamins and minerals. 10 people have made this recipe and would make it again. If you have walnut pieces, granulated sugar, baking powder, and a few other ingredients on hand, you can make it. It is brought to you by Foodista. From preparation to the plate, this recipe takes roughly <b>roughly 45 minutes</b>. Overall, this recipe earns a <b>rather bad spoonacular score of 22%</b>. <a href=\"https://spoonacular.com/recipes/fresh-fig-walnut-and-rosemary-upside-down-cake-57365\">Fresh Fig, Walnut, And Rosemary Upside-down Cake</a>, <a href=\"https://spoonacular.com/recipes/honey-and-rosemary-upside-down-fig-cake-628028\">Honey and Rosemary Upside Down Fig Cake</a>, and <a href=\"https://spoonacular.com/recipes/upside-down-fresh-fig-cake-130169\">Upside-Down Fresh Fig Cake</a> are very similar to this recipe.",
