    "summary": "Spicy Chicken Corn Dogs with Homemade Chili Sauce takes approximately <b>about 45 minutes</b> from beginning to end. This hor d'oeuvre has <b>434 calories</b>, <b>14g of protein</b>, and <b>25g of fat</b> per serving. This recipe serves 8 and costs $1.62 per serving. A mixture of rice flour, fire-roasted tomatoes, , and a handful of other ingredients are all it takes to make this recipe so delicious. It is brought to you by Foodista. 10 people have made this recipe and would make it again. It can be enjoyed any time, but it is especially good for <b>The Super Bowl</b>. It is a <b>rather inexpensive</b> recipe for fans of American food. It is a good option if you're following a <b>gluten free and dairy free</b> diet. Taking all factors into account, this recipe <b>earns a spoonacular score of 40%</b>, which is not so spectacular. If you like this recipe, take a look at these similar recipes: <a href=\"https://spoonacular.com/recipes/hot-dogs-three-ways-pepper-jam-chili-sauce-bourbon-caramelized-onions-and-spicy-tomato-relish-522850\">Hot Dogs Three Ways – Pepper Jam/Chili Sauce, Bourbon Caramelized Onions and Spicy Tomato Relish</a>, <a href=\"https://spoonacular.com/recipes/homemade-corn-dogs-667225\">Homemade Corn Dogs</a>, and <a href=\"https://spoonacular.com/recipes/grilled-corn-with-spicy-chili-mayo-coconut-and-fish-sauce-149253\">Grilled Corn with Spicy Chili Mayo, Coconut, and Fish Sauce</a>.",
