    "summary": "This recipe serves 10 and costs $1.27 per serving. One serving contains <b>305 calories</b>, <b>8g of protein</b>, and <b>11g of fat</b>. A few people made this recipe, and 18 would say it hit the spot. If you have condensed milk, water, mango, and a few other ingredients on hand, you can make it. It is a good option if you're following a <b>gluten free and vegetarian</b> diet. From preparation to the plate, this recipe takes around <b>45 minutes</b>. All things considered, we decided this recipe <b>deserves a spoonacular score of 38%</b>. This score is not so excellent. Try <a href=\"https://spoonacular.com/recipes/strawberry-cheesecake-ice-cream-913568\">Strawberry Cheesecake Ice Cream</a>, <a href=\"https://spoonacular.com/recipes/eggless-mango-cheesecake-no-bake-mango-cheesecake-486659\">eggless mango cheesecake | no bake mango cheesecake</a>, and <a href=\"https://spoonacular.com/recipes/strawberry-cookies-and-cream-ice-cream-917912\">Strawberry Cookies and Cream Ice Cream</a> for similar recipes.",
