    "instructions": "<ol><li>Add the first 6 ingredients to a two litre plastic jug.  Use a stick blender to thoroughly mix the ingredients and fluff the mixture up.d:</li><li>Place the jug in the freezer and freeze until the mixture starts to set.</li><li>Use the stick blender to mix the ice-cream again for about 30 seconds. Return the mix to the freezer.</li><li>Repeat this step again as the ice-cream is setting.</li><li>Once the mixture has been re-mixed twice, transfer the ice-cream to a deep metal dish and return to the freezer.  Choose a dish which is large enough and has enough space to use the stick blender.</li><li>Blend in the metal container twice before allowing to completely freeze.</li><li>Place all the mango syrup ingredients in a saucepan and using a stick blender puree the mix.</li><li>Heat the syrup and let it boil for 5 minutes stirring regularly.</li><li>Reduce the heat slightly and stir for a further two minutes or until the mixture is at a desirable syrup consistently.  It will thicken slightly on cooling.</li><li>Pour the cooled syrup over the ice-cream for a delicious Mango Cheesecake Ice-Cream.</li></ol>",
