    "summary": "Cheesy Turkey Meatballs might be just the main course you are searching for. This recipe makes 4 servings with <b>465 calories</b>, <b>37g of protein</b>, and <b>12g of fat</b> each. For <b>$2.67 per serving</b>, this recipe <b>covers 25%</b> of your daily requirements of vitamins and minerals. From preparation to the plate, this recipe takes approximately <b>45 minutes</b>. Not a lot of people made this recipe, and 6 would say it hit the spot. Head to the store and pick up egg, breadcrumbs, worcestershire, and a few other things to make it today. To use up the egg you could follow this main course with the <a href=\"https://spoonacular.com/recipes/rose-levy-beranbaums-chocolate-tomato-cake-with-mystery-ganache-27408\">Rose Levy Beranbaum's Chocolate Tomato Cake with Mystery Ganache</a> as a dessert. All things considered, we decided this recipe <b>deserves a spoonacular score of 68%</b>. This score is pretty good. Try <a href=\"https://spoonacular.com/recipes/cheesy-turkey-meatballs-543207\">Cheesy Turkey Meatballs</a>, <a href=\"https://spoonacular.com/recipes/cheesy-pizza-turkey-meatballs-539282\">Cheesy Pizza Turkey Meatballs</a>, and <a href=\"https://spoonacular.com/recipes/one-pot-cheesy-tortellini-and-meatballs-717281\">One Pot Cheesy Tortellini and Meatballs</a> for similar recipes.",
