    "summary": "The recipe Black Bean and Veggie Burgers with Corn Salsa could satisfy your American craving in roughly <b>45 minutes</b>. Watching your figure? This dairy free recipe has <b>160 calories</b>, <b>7g of protein</b>, and <b>2g of fat</b> per serving. For <b>76 cents per serving</b>, this recipe <b>covers 13%</b> of your daily requirements of vitamins and minerals. If you have beans, flour, ground pepper, and a few other ingredients on hand, you can make it. 36 people were impressed by this recipe. All things considered, we decided this recipe <b>deserves a spoonacular score of 83%</b>. This score is excellent. Try <a href=\"https://spoonacular.com/recipes/southwest-veggie-burgers-with-black-bean-and-corn-salsa-512526\">Southwest Veggie Burgers with Black Bean and Corn Salsa</a>, <a href=\"https://spoonacular.com/recipes/black-bean-veggie-burgers-601801\">Black Bean Veggie Burgers</a>, and <a href=\"https://spoonacular.com/recipes/tex-mex-black-bean-veggie-burgers-491835\">Tex-Mex Black Bean Veggie Burgers</a> for similar recipes.",
