    "summary": "Cheese Tortellini With Shrimp In Tomato Cream Sauce might be just the main course you are searching for. For <b>$4.07 per serving</b>, this recipe <b>covers 24%</b> of your daily requirements of vitamins and minerals. Watching your figure? This pescatarian recipe has <b>895 calories</b>, <b>48g of protein</b>, and <b>45g of fat</b> per serving. From preparation to the plate, this recipe takes about <b>45 minutes</b>. A couple people made this recipe, and 17 would say it hit the spot. If you have parmesan cheese, parsley, olive oil, and a few other ingredients on hand, you can make it. To use up the olive oil you could follow this main course with the <a href=\"https://spoonacular.com/recipes/sauteed-banana-granola-and-yogurt-parfait-624619\">Sauteed Banana, Granolan and Yogurt Parfait</a> as a dessert. All things considered, we decided this recipe <b>deserves a spoonacular score of 67%</b>. This score is pretty good. Try <a href=\"https://spoonacular.com/recipes/shrimp-tortellini-in-tomato-cream-for-two-412654\">Shrimp & Tortellini in Tomato Cream for Two</a>, <a href=\"https://spoonacular.com/recipes/tortellini-shrimp-skewers-with-sun-dried-tomato-sauce-427400\">Tortellini & Shrimp Skewers with Sun-Dried Tomato Sauce</a>, and <a href=\"https://spoonacular.com/recipes/tortellini-with-tomato-cream-sauce-417827\">Tortellini with Tomato-Cream Sauce</a> for similar recipes.",
