    "imageType": "jpg",
    "summary": "Need a <b>gluten free and vegan side dish</b>? Cannellini Bean and Asparagus Salad with Mushrooms could be a tremendous recipe to try. One serving contains <b>269 calories</b>, <b>8g of protein</b>, and <b>20g of fat</b>. For <b>93 cents per serving</b>, this recipe <b>covers 8%</b> of your daily requirements of vitamins and minerals. Plenty of people made this recipe, and 309 would say it hit the spot. From preparation to the plate, this recipe takes approximately <b>45 minutes</b>. If you have lemon zest, grain mustard, tarragon, and a few other ingredients on hand, you can make it. All things considered, we decided this recipe <b>deserves a spoonacular score of 70%</b>. This score is solid. Try <a href=\"https://spoonacular.com/recipes/cannellini-bean-salad-422994\">Cannellini Bean Salad</a>, <a href=\"https://spoonacular.com/recipes/refreshing-cannellini-bean-salad-113127\">Refreshing Cannellini Bean Salad</a>, and <a href=\"https://spoonacular.com/recipes/avocado-and-cannellini-bean-salad-633120\">Avocado and Cannellini Bean Salad</a> for similar recipes.",
