    "summary": "For <b>$1.4 per serving</b>, this recipe <b>covers 7%</b> of your daily requirements of vitamins and minerals. One serving contains <b>541 calories</b>, <b>6g of protein</b>, and <b>44g of fat</b>. A mixture of dash allspice, cream, cranberries, and a handful of other ingredients are all it takes to make this recipe so tasty. 110 people were impressed by this recipe. It can be enjoyed any time, but it is especially good for <b>Christmas</b>. From preparation to the plate, this recipe takes roughly <b>45 minutes</b>. All things considered, we decided this recipe <b>deserves a spoonacular score of 29%</b>. This score is not so excellent. Try <a href=\"https://spoonacular.com/recipes/pumpkin-cheesecake-with-candied-cranberries-759018\">Pumpkin Cheesecake with Candied Cranberries</a>, <a href=\"https://spoonacular.com/recipes/goat-cheese-cheesecake-with-honeyed-cranberries-55593\">Goat Cheese Cheesecake with Honeyed Cranberries</a>, and <a href=\"https://spoonacular.com/recipes/cheesecake-tart-with-cranberries-in-port-glaze-128220\">Cheesecake Tart with Cranberries in Port Glaze</a> for similar recipes.",
