    "instructions": "<ol><li>In a medium saucepan, bring cranberries and water to a boil.  Boil until the skin of the berries pops open, about 5 minutes.</li><li>Remove from heat and add allspice, cloves, orange extract, and sugar. Mix until thoroughly combined. Cool in refrigerator.</li><li>For the crust, combine digestive cookies crumbs, sugar, and butter in a small bowl. Press into the bottom of a greased 9-inch spring form pan; set aside.</li><li>In a mixing bowl, beat the cream cheese and sugar until smooth.</li><li>Add sour cream and cornstarch, beating well.</li><li>Add eggs, and beat on low speed just until combined.</li><li>Drain the cranberry sauce, reserve the cranberries. Fold one cup of cranberry sauce into the mixture. Pour into crust, sprinkle with the remaining sauce.</li><li>Bake the cake at 160C for 30-35 minutes or until the center is almost set. Cool on a wire rack for 10 minutes. Carefully run a knife around the edge of the pan to loosen; cool one hour longer. Refrigerate overnight.</li><li>Before serving, if you wish, top the cake with cranberries from the sauce.</li></ol>",
