    "summary": "You can never have too many main course recipes, so give Alouette Chicken Paprikan a try. This recipe makes 4 servings with <b>172 calories</b>, <b>25g of protein</b>, and <b>6g of fat</b> each. For <b>$1.28 per serving</b>, this recipe <b>covers 16%</b> of your daily requirements of vitamins and minerals. A few people made this recipe, and 49 would say it hit the spot. If you have alouette garlic & herbs spreadable cheese, butter, chicken breasts halves, and a few other ingredients on hand, you can make it. It is a good option if you're following a <b>gluten free and primal</b> diet. All things considered, we decided this recipe <b>deserves a spoonacular score of 70%</b>. This score is good. Try <a href=\"https://spoonacular.com/recipes/chicken-alouette-135800\">Chicken Alouette</a>, <a href=\"https://spoonacular.com/recipes/alouette-summer-vegetables-105199\">Alouette Summer Vegetables</a>, and <a href=\"https://spoonacular.com/recipes/alouette-cranberry-brie-632253\">Alouette® Cranberry Brie</a> for similar recipes.",
