    "id": 776505,
    "title": "Sausage & Pepperoni Stromboli",
    "readyInMinutes": 28,
    "servings": 6,
    "sourceUrl": "http://asouthern-soul.blogspot.com/2014/11/sausage-pepperoni-stromboli.html",
    "image": "https://spoonacular.com/recipeImages/776505-556x370.jpg",
    "imageType": "jpg",
    "summary": "Sausage & Pepperoni Stromboli might be just the main course you are searching for. For <b>$2.58 per serving</b>, this recipe <b>covers 19%</b> of your daily requirements of vitamins and minerals. One serving contains <b>689 calories</b>, <b>33g of protein</b>, and <b>45g of fat</b>. This recipe is liked by 64426 foodies and cooks. A mixture of egg, mozzarella cheese, parmesan cheese, and a handful of other ingredients are all it takes to make this recipe so yummy. To use up the pizza dough you could follow this main course with the <a href=\"https://spoonacular.com/recipes/grilled-dessert-pizza-203680\">Grilled Dessert Pizza</a> as a dessert. All things considered, we decided this recipe <b>deserves a spoonacular score of 70%</b>. This score is good. Try <a href=\"https://spoonacular.com/recipes/pepperoni-sausage-stromboli-570172\">Pepperoni & Sausage Stromboli</a>, <a href=\"https://spoonacular.com/recipes/pepperoni-stromboli-176095\">Pepperoni Stromboli</a>, and <a href=\"https://spoonacular.com/recipes/pepperoni-stromboli-444704\">Pepperoni Stromboli</a> for similar recipes.",
