    "occasions": [ ],
    "instructions": "<p>Cook Italian sausage in a medium skillet until browned. Drain on paper towels and crumble into small pieces.</p><p>Heat oven to 450 degrees.</p><p>Place parchment paper on a baking pan and lightly flour. Roll dough out to form a large rectangle.</p><p>Brush a thin layer of pizza sauce on dough. Layer on crumbled sausage then mozzarella cheese.</p><p>Place pepperoni slices on top of cheese then sprinkle with 3/4 cup Parmesan cheese.</p><p>Gently roll in short sides of dough to form a seal around filling.</p><p>Starting on long side of dough, carefully roll into one third of Stromboli. Using parchment, roll dough again until reaching opposite end. Pinch together and place seam side down.</p><p>Mix egg with 1 tablespoon of water. Brush egg mixture over Stromboli and sprinkle with remaining 1/4 Parmesan cheese.</p><p>Place in oven and IMMEDIATELY TURN OVEN DOWN to 350 degrees.</p><p>Bake for approximately 18 minutes. Remove from oven and let rest for 10 minutes. </p><p>Test center of turnover. If dough is not completely cooked, slice Stromboli in half and bake for additional 5-8 minutes.</p><p>Serve with warm pizza sauce</p>",
