    "summary": "The recipe Crepes Suzette could satisfy your Mediterranean craving in approximately <b>45 minutes</b>. For <b>86 cents per serving</b>, you get a morn meal that serves 4. One serving contains <b>613 calories</b>, <b>11g of protein</b>, and <b>39g of fat</b>. A couple people made this recipe, and 45 would say it hit the spot. It is a good option if you're following a <b>vegetarian</b> diet. A mixture of butter, salt, water, and a handful of other ingredients are all it takes to make this recipe so delicious. All things considered, we decided this recipe <b>deserves a spoonacular score of 46%</b>. This score is solid. Try <a href=\"https://spoonacular.com/recipes/crpes-suzette-247617\">Crêpes Suzette</a>, <a href=\"https://spoonacular.com/recipes/crpes-suzette-212880\">Crêpes Suzette</a>, and <a href=\"https://spoonacular.com/recipes/crepes-suzette-393747\">Crepes Suzette</a> for similar recipes.",
