    "summary": "The recipe Halloween Mocha Cupcakes could satisfy your American craving in about <b>45 minutes</b>. For <b>$1.37 per serving</b>, this recipe <b>covers 7%</b> of your daily requirements of vitamins and minerals. This recipe makes 12 servings with <b>445 calories</b>, <b>6g of protein</b>, and <b>30g of fat</b> each. It can be enjoyed any time, but it is especially good for <b>Halloween</b>. A mixture of coffee extract, halloween sprinkles, heavy cream, and a handful of other ingredients are all it takes to make this recipe so tasty. 10 people have made this recipe and would make it again. All things considered, we decided this recipe <b>deserves a spoonacular score of 24%</b>. This score is not so excellent. Try <a href=\"https://spoonacular.com/recipes/halloween-cupcakes-277474\">Halloween Cupcakes</a>, <a href=\"https://spoonacular.com/recipes/halloween-cupcakes-820640\">Halloween Cupcakes</a>, and <a href=\"https://spoonacular.com/recipes/halloween-dot-cupcakes-165940\">Halloween Dot Cupcakes</a> for similar recipes.",
