    "summary": "Chicken Enchilada Casserole is a Mexican main course. This recipe serves 8 and costs $1.22 per serving. One portion of this dish contains around <b>17g of protein</b>, <b>12g of fat</b>, and a total of <b>286 calories</b>. This recipe is liked by 9022 foodies and cooks. <b>Autumn</b> will be even more special with this recipe. If you have canned tomatoes, green onion tops optional, chicken pre, and a few other ingredients on hand, you can make it. From preparation to the plate, this recipe takes approximately <b>45 minutes</b>. It is brought to you by Pink When. With a spoonacular <b>score of 0%</b>, this dish is improvable. Try <a href=\"https://spoonacular.com/recipes/chicken-enchilada-casserole-108065\">Chicken Enchilada Casserole</a>, <a href=\"https://spoonacular.com/recipes/chicken-enchilada-casserole-145339\">Chicken Enchilada Casserole</a>, and <a href=\"https://spoonacular.com/recipes/chicken-enchilada-casserole-890348\">Chicken Enchilada Casserole</a> for similar recipes.",
