    "summary": "Crispy Tiger Prawns With Honey and Garlic Sauce could be just the <b>gluten free, dairy free, and pescatarian</b> recipe you've been looking for. One serving contains <b>159 calories</b>, <b>6g of protein</b>, and <b>8g of fat</b>. This recipe serves 3. For <b>$1.16 per serving</b>, this recipe <b>covers 5%</b> of your daily requirements of vitamins and minerals. From preparation to the plate, this recipe takes approximately <b>approximately 45 minutes</b>. 7 people have made this recipe and would make it again. A mixture of shao hsing wine, honey, egg yolk, and a handful of other ingredients are all it takes to make this recipe so flavorful. It is brought to you by Foodista. All things considered, we decided this recipe <b>deserves a spoonacular score of 15%</b>. This score is rather bad. <a href=\"https://spoonacular.com/recipes/crispy-tiger-prawns-with-honey-and-garlic-sauce-75765\">Crispy Tiger Prawns With Honey And Garlic Sauce</a>, <a href=\"https://spoonacular.com/recipes/celeriac-espuma-with-ras-el-hanout-steamed-tiger-prawns-11921\">Celeriac Espuma With Ras-el-hanout Steamed Tiger Prawns</a>, and <a href=\"https://spoonacular.com/recipes/crispy-prawns-with-cucumber-dipping-sauce-23071\">Crispy Prawns With Cucumber Dipping Sauce</a> are very similar to this recipe.",
