    "summary": "If you want to add more <b>lacto ovo vegetarian</b> recipes to your recipe box, Oreo Mini Cheesecake might be a recipe you should try. One portion of this dish contains around <b>4g of protein</b>, <b>15g of fat</b>, and a total of <b>205 calories</b>. For <b>51 cents per serving</b>, this recipe <b>covers 4%</b> of your daily requirements of vitamins and minerals. This recipe serves 12. A mixture of cream cheese, eggs, vanillan extract, and a handful of other ingredients are all it takes to make this recipe so scrumptious. It is brought to you by Foodista. 9 people have made this recipe and would make it again. From preparation to the plate, this recipe takes about <b>about 45 minutes</b>. All things considered, we decided this recipe <b>deserves a spoonacular score of 9%</b>. This score is very bad (but still fixable). <a href=\"https://spoonacular.com/recipes/copycat-cheesecake-factory-oreo-cheesecake-552762\">Copycat Cheesecake Factory Oreo Cheesecake</a>, <a href=\"https://spoonacular.com/recipes/cheesecake-factory-bakery-oreo-cheesecake-600720\">Cheesecake Factory Bakery Oreo Cheesecake</a>, and <a href=\"https://spoonacular.com/recipes/mini-oreo-cheesecakes-848189\">Mini Oreo Cheesecakes</a> are very similar to this recipe.",
