    "id": 645714,
    "title": "Grilled Fish With Sun Dried Tomato Relish",
    "readyInMinutes": 45,
    "servings": 2,
    "sourceUrl": "http://www.foodista.com/recipe/MNHCWRZH/grilled-fish-with-sun-dried-tomato-relish",
    "image": "https://spoonacular.com/recipeImages/645714-556x370.jpg",
    "imageType": "jpg",
    "summary": "You can never have too many main course recipes, so give Grilled Fish With Sun Dried Tomato Relish a try. One serving contains <b>703 calories</b>, <b>42g of protein</b>, and <b>25g of fat</b>. This gluten free, dairy free, fodmap friendly, and pescatarian recipe serves 2 and costs <b>$7.34 per serving</b>. 16 people have tried and liked this recipe. It can be enjoyed any time, but it is especially good for <b>The Fourth Of July</b>. If you have pepper, extra virgin olive oil, salt, and a few other ingredients on hand, you can make it. To use up the salt you could follow this main course with the <a href=\"https://spoonacular.com/recipes/apple-turnovers-recipe-48175\">Apple Turnovers Recipe</a> as a dessert. All things considered, we decided this recipe <b>deserves a spoonacular score of 93%</b>. This score is amazing. Try <a href=\"https://spoonacular.com/recipes/artichoke-and-sun-dried-tomato-pasta-926592\">Artichoke and Sun Dried Tomato Pasta</a>, <a href=\"https://spoonacular.com/recipes/grilled-tuna-with-sun-dried-tomato-relish-8067\">Grilled Tuna With Sun-dried Tomato Relish</a>, and <a href=\"https://spoonacular.com/recipes/sun-dried-tomato-pesto-pasta-with-zoodles-914788\">Sun Dried Tomato Pesto Pasta with Zoodles</a> for similar recipes.",
    "cuisines": [ ],
    "dishTypes": [
    "lunch",
    "main course",
    "main dish",
    "dinner"
    ],
    "diets": [
    "gluten free",
    "dairy free",
    "fodmap friendly",
    "pescatarian"
    ],
    "occasions": [
    "father's day",
    "4th of july",
    "summer"
    ],
    "instructions": "<ol><li>Pre-heat the oven to 200 deg Celsius.</li><li>Lay a sheet of baking paper on a baking tray and grease it lightly with olive oil. Lay the whole fish fillet on the baking sheet and rub the fish generously with the rest of the olive oil.</li><li>Season with salt and pepper. I like to use Masterfoods Garlic Pepper whenever a recipe calls for salt and pepper.</li><li>Place the fish in an oven pre-heated to 200 deg Celsius for 15-20 minutes until fish is cooked. Do not overcook the fish. The standard, fan-forced or grill functions of the oven may be used.</li><li>While the fish is cooking, lightly peel a piece of cucumber. About 150g large. Leave some skin on for a prettier appearance. Cut the cucumber into strips and trim off the seeds. Retain the crunchy parts. Dice the cucumber strips. Set aside the cucumber dices in a bowl.</li><li>Use only sun-dried tomatoes that are soaked in oil. Remove the tomatoes from the jar and drain the excess oil. Cut the tomatoes into small pieces. Add the tomatoes to the cucumber.</li><li>Stack 5 leaves of mint or basil together. Roll up the stack of leaves. Using a pair of kitchen scissors, cut the herbs into fine strips. Add them to the tomato mixture.</li><li>Add salt and pepper to taste, 1/2 teaspoon of sugar, 1 teaspoon of extra virgin olive oil, 1/2 teaspoon of balsamic vinegar and 1 teaspoon of toasted sesame seeds. Stir the tomato relish mixture well to combine.</li><li>Remove the fish from the oven. Cut into servicing portions and place the relish on the top of the each fish fillet.</li><li>Garnish with sprigs of mint or basil.</li></ol>",
