    "summary": "You can never have too many Mediterranean recipes, so give Spanakopita Cups a try. For <b>60 cents per serving</b>, you get a side dish that serves 36. One portion of this dish contains around <b>4g of protein</b>, <b>12g of fat</b>, and a total of <b>171 calories</b>. If you have butter, scallions, eggs, and a few other ingredients on hand, you can make it. From preparation to the plate, this recipe takes around <b>around 45 minutes</b>. 10 people have tried and liked this recipe. It is brought to you by Foodista. With a spoonacular <b>score of 33%</b>, this dish is rather bad. Try <a href=\"https://spoonacular.com/recipes/spanakopita-40024\">Spanakopita</a>, <a href=\"https://spoonacular.com/recipes/spanakopita-69627\">Spanakopita</a>, and <a href=\"https://spoonacular.com/recipes/spanakopita-73089\">Spanakopita</a> for similar recipes.",
