    "summary": "Caramel Macchiato Cake might be just the dessert you are searching for. One serving contains <b>651 calories</b>, <b>7g of protein</b>, and <b>23g of fat</b>. This recipe serves 10 and costs $1.54 per serving. If you have heavy whipping cream, gelatin powder, instant coffee, and a few other ingredients on hand, you can make it. A few people made this recipe, and 36 would say it hit the spot. From preparation to the plate, this recipe takes around <b>3 hours</b>. All things considered, we decided this recipe <b>deserves a spoonacular score of 29%</b>. This score is not so spectacular. Similar recipes include <a href=\"https://spoonacular.com/recipes/4-ingredient-chocolate-caramel-macchiato-mug-cake-620257\">4 Ingredient Chocolate Caramel Macchiato Mug Cake</a>, <a href=\"https://spoonacular.com/recipes/caramel-macchiato-gooey-cake-bars-490792\">Caramel Macchiato Gooey Cake Bars</a>, and <a href=\"https://spoonacular.com/recipes/skinny-caramel-macchiato-ice-cream-with-homemade-caramel-drizzle-608749\">{Skinny} Caramel Macchiato Ice Cream with Homemade Caramel Drizzle</a>.",
    "cuisines": [ ],
