    "summary": "You can never have too many main course recipes, so give Beef Pot Pies with Irish Cheddar Crust a try. One portion of this dish contains roughly <b>43g of protein</b>, <b>38g of fat</b>, and a total of <b>714 calories</b>. This recipe serves 6 and costs $1.92 per serving. 9 people were glad they tried this recipe. This recipe is typical of European cuisine. It can be enjoyed any time, but it is especially good for <b>st. patrick day</b>. This recipe from Foodista requires flour, vegetable oil, garlic, and flour. From preparation to the plate, this recipe takes about <b>about 45 minutes</b>. All things considered, we decided this recipe <b>deserves a spoonacular score of 74%</b>. This score is solid. Similar recipes include <a href=\"https://spoonacular.com/recipes/irish-beef-hand-pies-93909\">Irish Beef Hand Pies</a>, <a href=\"https://spoonacular.com/recipes/irish-beef-and-vegetable-hand-pies-a-st-patricks-day-delight-578688\">Irish Beef and Vegetable Hand Pies: A St. Patrick's Day Delight</a>, and <a href=\"https://spoonacular.com/recipes/pizza-pot-pies-with-whole-wheat-crust-topping-71358\">Pizza Pot Pies With Whole Wheat Crust Topping</a>.",
