    "summary": "Soy Ginger Glazed Halibut w/ Ginger Peach Relish is a <b>gluten free, dairy free, and pescatarian</b> main course. This recipe makes 2 servings with <b>375 calories</b>, <b>49g of protein</b>, and <b>10g of fat</b> each. For <b>$8.97 per serving</b>, this recipe <b>covers 31%</b> of your daily requirements of vitamins and minerals. From preparation to the plate, this recipe takes roughly <b>45 minutes</b>. 58 people have made this recipe and would make it again. If you have jalapeno, soy sauce, wine, and a few other ingredients on hand, you can make it. To use up the lime you could follow this main course with the <a href=\"https://spoonacular.com/recipes/lime-angel-food-cake-with-lime-glaze-and-pistachios-185602\">Lime Angel Food Cake with Lime Glaze and Pistachios</a> as a dessert. All things considered, we decided this recipe <b>deserves a spoonacular score of 93%</b>. This score is super. Try <a href=\"https://spoonacular.com/recipes/sticky-ginger-soy-glazed-chicken-922529\">Sticky Ginger Soy Glazed Chicken</a>, <a href=\"https://spoonacular.com/recipes/ginger-peach-glazed-ham-299990\">Ginger-Peach Glazed Ham</a>, and <a href=\"https://spoonacular.com/recipes/ginger-peach-glazed-ham-12742\">Ginger Peach-glazed Ham</a> for similar recipes.",
