    "imageType": "jpg",
    "summary": "Chicken and Mango Skewer might be just the main course you are searching for. This gluten free, dairy free, and whole 30 recipe serves 1 and costs <b>$3.67 per serving</b>. One serving contains <b>420 calories</b>, <b>30g of protein</b>, and <b>7g of fat</b>. A couple people made this recipe, and 19 would say it hit the spot. A mixture of chicken breast, chicken stock cube, mangos, and a handful of other ingredients are all it takes to make this recipe so tasty. To use up the vegetable cooking oil you could follow this main course with the <a href=\"https://spoonacular.com/recipes/banana-bread-no7-523115\">Banana Bread no.7</a> as a dessert. From preparation to the plate, this recipe takes about <b>45 minutes</b>. All things considered, we decided this recipe <b>deserves a spoonacular score of 95%</b>. This score is outstanding. Try <a href=\"https://spoonacular.com/recipes/grilled-chicken-caesar-on-a-skewer-338979\">Grilled Chicken Caesar on a Skewer</a>, <a href=\"https://spoonacular.com/recipes/thai-chicken-skewer-appetizers-with-sweet-and-spicy-chili-sauce-621582\">Thai Chicken Skewer Appetizers with Sweet and Spicy Chili Sauce</a>, and <a href=\"https://spoonacular.com/recipes/caprese-skewer-301739\">Caprese Skewer</a> for similar recipes.",
