    "instructions": "Preheat oven to 350 F. Generously coat skins of potatoes with oil (will make skin crispy). Bake for 1 to 1 1/2 hours or until tender.\nWhile potatoes are baking in the oven chop & mix together the red onion, tomato, garlic, fresh basil & cheese in a small bowl. Set aside.\nWhen potatoes are done cut small slices off the top of each potato, scoop out the soft flesh and place in a large bowl. Place empty shells on a baking sheet and turn oven down to 150 F.\nMix and mash in cultured dairy, butter & olive oil. Pour bruschetta mixture in and stir well. Season to taste with sea salt and pepper.\nSpoon the bruschetta potato mixture back into the shells and return them to the oven to keep warm. If potatoes are not reheated to a high temperature, the enzymes in the dairy will be preserved.",
